import React from 'react'

function articleList({ articles }) {
  return (
    <div>
    {articles.map(article => {
        return (
          <div key= {article.id}>
            <h2>{article.title}</h2>
            <p>{article.body}</p>

            
  
          </div>  
  
        )
      })}
    </div>
  )
}

export default articleList
